import React from 'react'

const Entry = (props) => {
    return (
        <div style={{displ}}>
            <p>
                {
                    props.entry
                }
            </p>
            <button onClick={()=> {
                props.del(props.entry)
            }}>
                Delete
            </button>
        </div>
    )
}

export default Entry
